import React from 'react';

const Sidebar = () => {

  return (
    <div class="sidebar" id="sidebar">
		<div class="sidebar-inner slimscroll">
			<div id="sidebar-menu" class="sidebar-menu">
				<ul>
					<li class="active"> <a href="home.html"><i class="fas fa-tachometer-alt"></i> <span>Dashboard</span></a> </li>
					<li class="list-divider"></li>
					<li class="submenu"> <a href="#"><i class="fas fa-suitcase"></i> <span> Service List </span> <span class="menu-arrow"></span></a>
                        <ul class="submenu_class" style="display: none;">
                        <li><a href="all-service-list.html"> All Service </a></li>
                        </ul>
					</li>
					<li class="submenu"> <a href="#"><i class="fas fa-user"></i> <span> Users List</span> <span class="menu-arrow"></span></a>
						<ul class="submenu_class" style="display: none;">
							<li><a href="all-users.html">All Users </a></li>
						</ul>
					</li>
				</ul>
			</div>
		</div>
	</div>
  );
};

export default  Sidebar;
